import React from 'react';
import { StyleSheet, Text, View, Button, TextInput, TouchableOpacity} from 'react-native';

export default function TextField(props){
 return(
  <View style={styles.container}>
      <TextInput />
      <TouchableOpacity
        style={styles.addBtn}
      >
          <Text>Button</Text>
      </TouchableOpacity>
  </View>
 );
}

const styles = StyleSheet.create({
    container: {
        backgroundColor: '#FFF'
    }


})
